import Vue from "vue"
import vueRouter from "vue-router"

Vue.use(vueRouter)

import Home from "../views/Home/Home.vue"

const router = new vueRouter({
    routes:[
        {
            path:"/",
            redirect:"/home"
        },{
            path:"/home",
            component:Home
        }
        
    ]
})

export default router
